import React from 'react';
import {Component} from 'react';

class PersonalInfo extends Component {
  constructor() {
    super ()
  }
  onSubmitTask = (e) => {
    e.preventDefault();
  };

  render() {
    return (
      <form onSubmit={this.onSubmitTask}>
        <label>Name</label>
        <input
         type="text"
         id="nameInput"
         />
        <label>LastName</label>
        <input
          type="text"
          id="lastNameInput"
        />
        <label>Email</label>
        <input type="text" id="emailInput"></input>
        <label>Adress</label>
        <label>Telephone Number</label>
        <input type="text" id="number1Input"></input>
        <button type="submit">Add Personal Data</button>
      </form>
    )
  }
}

export default PersonalInfo
